// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CrowdFunding {
    struct MakeCrowdFunding {
        string fundingName; // What this funding for
        address payable recipient; // address of the funding 
        uint value; // how much money the funding need 
        bool completed; // this funding is completed or not 
        mapping (address => bool) voters; // to check who has voted by their address
        uint numberOfVoters; // how many people have voted for the current funding
    }

    mapping(address => uint) public contributors;
    mapping(uint => MakeCrowdFunding) public makeCrowdFunding;
    address public manager;
    uint public deadline;
    uint public target;
    uint public minimumContribution;
    uint public raisedAmount;
    uint public numberOfContributors;
    uint public numberOfMakeCrowdFunding;

    constructor(uint _deadline, uint _target) {
        msg.sender == manager;
        deadline = _deadline; // deadline will be determined by input
        target = _target; // target will be determined by input
        minimumContribution = 1 ether; // minimum contribution to this crowdfunding is 1 ether
        numberOfMakeCrowdFunding = 0; // number of people that want to make a funding set to 0
    }

    modifier onlyManager() {
        require(msg.sender == manager);
        _;
    }

    function createCrowdFunding (string memory _fundingName, uint _value , address payable _recipient) public onlyManager {
        MakeCrowdFunding storage newCrowdFunding = makeCrowdFunding[numberOfMakeCrowdFunding]; // bring down struct and all the values to this function and set the variables
        newCrowdFunding.fundingName = _fundingName; // set fundingName in the struct by input
        newCrowdFunding.value = _value; // set value in the struct by input
        newCrowdFunding.recipient = _recipient; // set recipient in the struct by input
        numberOfContributors++; // incrementing the numberOfContributors because someone has called this function
        numberOfMakeCrowdFunding = 0; // set the number of people that want this funding happen to 0
    }

    function contribute() public payable {
        require(msg.value >= minimumContribution, "You have not met the minimum contribution");
        require(block.timestamp >= deadline, 'Deadline has been reached');

        if(contributors[msg.sender] == 0) {
            numberOfContributors++;
        }

        contributors[msg.sender] += msg.value; // assigning contributors variable's value by input
        raisedAmount += msg.value; // assigning raisedAmount variable to the total amount of contribution in the contract by adding it with the inputted money
    }

    function checkBalance() public view returns(uint) {
        return address(this).balance;
    }

    function refund() public {
        require(contributors[msg.sender] > 0, 'You are not a contributors'); // check if contributor has contribute or not
        require(block.timestamp > deadline && raisedAmount < target, 'Deadline has been reached and target amount is not reached yet'); // check if deadline has been reached and target is not reached yet
        payable(msg.sender).transfer(contributors[msg.sender]); // refunding the money who called this function
        contributors[msg.sender] = 0; // erasing the refunder from contributors
    }

    function voteCrowdFunding() public {
        require(contributors[msg.sender] > 0, 'You are not a contributors'); // check if contributor has contribute or not
        MakeCrowdFunding storage thisRequest = makeCrowdFunding[numberOfMakeCrowdFunding]; // bring down struct and all the variables
        require(thisRequest.voters[msg.sender] == false, 'You have already voted'); // check if the contributor has voted or not
        thisRequest.voters[msg.sender] = true; // assingning the voters address to true because he/she has voted
        thisRequest.numberOfVoters++; // incrementing the number of voters
    }

    function makePayment(uint _numRequest) public {
        require(raisedAmount >= target, 'Target amount is not reached yet'); // check raisedAmount is greater than or equal to the funding target or not 
        MakeCrowdFunding storage thisRequest = makeCrowdFunding[_numRequest]; // bring down struct and all the variables and set inputted value to be the struct index
        require(thisRequest.completed == false, 'This funding has already been completed'); // check if funding is completed or not 
        require(thisRequest.numberOfVoters >= numberOfContributors / 2, 'Not enough votes to make a payment'); // check the number of voters is greater than or equal to 50%
        thisRequest.recipient.transfer(thisRequest.value); // transfer the money to recipient
        thisRequest.completed = true; // changed this funding to completed;
    }
}

